package main

// isGood checks if a string of parentheses is balanced.
// A string is balanced if:
// 1. The total count of '(' equals the total count of ')'.
// 2. At no point during traversal from left to right does the count of ')' exceed the count of '('.
func isGood(s string) bool {
    balance := 0
    for _, char := range s {
        if char == '(' {
            balance++
        } else if char == ')' {
            balance--
        }
        // If balance drops below zero, it means we have a ')' without a preceding '('
        // making the string unbalanced at this point.
        if balance < 0 {
            return false
        }
    }
    // For a string to be perfectly balanced, the final balance must be zero.
    // This ensures that for every opening parenthesis, there is a corresponding closing one.
    return balance == 0
}

func MatchParens(lst []string) string {
    // The input list is guaranteed to have two strings.
    s1 := lst[0]
    s2 := lst[1]

    // There are two possible concatenations: s1 followed by s2, or s2 followed by s1.
    // We need to check if either of these results in a "good" (balanced) string.

    // Check the first possible concatenation: s1 + s2
    if isGood(s1 + s2) {
        return "Yes"
    }

    // If s1 + s2 was not good, check the second possible concatenation: s2 + s1
    if isGood(s2 + s1) {
        return "Yes"
    }

    // If neither concatenation results in a good string, return "No".
    return "No"
}
